import React from "react";
import "../style/style.css";
import { useNavigate } from "react-router-dom";

const Header = () => {
    const navigate = useNavigate();
    const changeRouteToHome = () => {
        navigate("/");
    }
    const changeRouteToSignUp = () => {
        navigate("/sign-up");
    }
    const changeRouteToLogIn = () => {
        navigate("/log-in");
    }
    
    return (
        <div className="header-container">
            <div onClick={changeRouteToHome}className="header-title">La Tribuna</div>
            <div className="header-buttons-container">
                <div onClick={changeRouteToSignUp}>Sign Up</div>
                <div onClick={changeRouteToLogIn}>Log In</div>
            </div>
        </div>
    )
}

export default Header;
